import React from 'react';
import CircularProgress from '@material-ui/core/CircularProgress';

export const Loading = () => {
	return(
	<div style={{
		marginTop:'25px',
		marginBottom: '25px'
	}}>
		<CircularProgress disableShrink style={{
		width:'50px',
		height: '50px'}} />
	</div>
	);
};
export default Loading;
